import logo from './logo.svg';
import { display } from '@mui/system';

//import component
import BiodataAvatar from './component/biodata-avatar'
import BiodataText from './component/biodata-bio';

// needed internal resource
import avatarImg from "./img/ava3.jpg";

const bioStyle = {
  height : "70vh",
  display: "flex",
  justifyContent : "center",
  alignItems : "center"
};

const bioItemStyle = {
  margin : "50px",
};

function Biodata() {
  const name = "Alfian Eza Putra"
  const whoami = "System Administrator"
  const bio = "This is mmy bio data you can call me eza afbjkawjkf awjfhnawejf awleifhaef awidfhaweidhad njjasj asjkdnasd uidf njsjd nn askldmsmd"
  const image = avatarImg

  return (
    <div className='bio' style={bioStyle}>
      <span style={bioItemStyle}><BiodataAvatar image={image}/></span>
      <span style={bioItemStyle}><BiodataText name={name} 
                                              whoami={whoami}
                                              bio={bio}
                                              />
      </span>
    </div>
  );
}

export default Biodata;
